// src/App.js
import React from 'react';
import './App.css';
import PaginatedCards from './components/PaginatedCards';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <h1>Magic: The Gathering Deck Builder</h1>
                <PaginatedCards />
            </header>
        </div>
    );
}

export default App;
